import React from 'react';
import Header from '../components/Header';

const ImagesPage = () => {
  const sampleImages = [
    { id: 1, src: '/assets/card1.jpg', title: 'Nature' },
    { id: 2, src: '/assets/card2.jpg', title: 'City' },
    { id: 3, src: '/assets/card3.jpg', title: 'Abstract' },
  ];

  return (
    <div>
      <Header />
      <section style={{ padding: '4rem 2rem', minHeight: '60vh' }}>
        <h1 style={{ textAlign: 'center', marginBottom: '3rem' }}>Our Gallery</h1>
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: '2rem', maxWidth: '1200px', margin: '0 auto' }}>
          {sampleImages.map(image => (
            <div key={image.id} style={{ textAlign: 'center' }}>
              <img 
                src={image.src} 
                alt={image.title}
                style={{ width: '100%', height: '200px', objectFit: 'cover', borderRadius: '10px' }}
              />
              <h3>{image.title}</h3>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
};
